import { styled } from "@material-ui/styles";

const Container = styled.div`
  height: 70vh;
  max-width: 100vw;
  display: flex;
  justify-content: space-around;
  align-items: center;
`;
const Item = styled.div``;
const Title = styled.div``;
const SubTitle = styled.div``;

function Footer() {
  return (
    <Container>
      <Item>
        <Title>MENSWEAR.</Title>
        <SubTitle>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Ex, delectus
          eos? Illum nam tempore nihil repellendus deserunt nulla officiis atque
          sequi. Ratione, repellat nisi temporibus quod accusantium id odit a.
        </SubTitle>
      </Item>
      <Item>
        <Title></Title>
        <SubTitle></SubTitle>
        <SubTitle></SubTitle>
        <SubTitle></SubTitle>
        <SubTitle></SubTitle>
        <SubTitle></SubTitle>
      </Item>
      <Item>
        <Title></Title>
        <SubTitle></SubTitle>
        <SubTitle></SubTitle>
        <SubTitle></SubTitle>
        <SubTitle></SubTitle>
        <SubTitle></SubTitle>
      </Item>
      <Item>
        <Title></Title>
        <SubTitle></SubTitle>
      </Item>
    </Container>
  );
}

export default Footer;
